INSERT INTO `blogs` VALUES ('062f28e3-8998-4eee-b34c-c5e9841f7867',1702746327301,1702889445637,'https://cali.vn/blog/uong-sua-dau-nanh-co-tang-vong-1-khong','63c57e3d-0489-42d2-accd-764cf3a53edf','<figure class=\"image\"><img style=\"aspect-ratio:1000/667;\" src=\"https://firebasestorage.googleapis.com/v0/b/vue-authentication-5990a.appspot.com/o/blogs%2F1702889430671blog2.jpg?alt=media&amp;token=d6e7057d-e95a-47f6-aa21-8050ac67a3d9\" width=\"1000\" height=\"667\"></figure><p>Thành phần đậu nành có một lượng lớn phytoestrogen có tác dụng tương tự như hormone estrogen (nhưng hiệu quả cao hơn Estrogen) giúp vòng 1 của phụ nữ phát triển tự nhiên. Ngoài ra, các acid béo không bão hòa đơn trong sữa đậu nành có tác dụng ức chế sự hấp thu chất béo của đường ruột giúp giảm nguy cơ tăng cân. Uống sữa đậu nành cũng cung cấp thêm nhiều chất xơ hơn, làm bạn no trong thời gian dài hơn chống cảm giác thèm ăn.</p>','Uống sữa đậu nành có tăng vòng 1 không?','a019eec1-e81d-4195-af8d-d9e9d92fbab8','ec9a19be-bd96-4183-9147-3a88b4451bd6',NULL),('363c4d8f-2a87-488b-b1b4-4f85a2c0e468',1702053481340,1702053481341,'https://eutrip.vn/view/admin/Themes/kcfinder/upload/images/tour/vuongquocanh.jpg','7e68977b-2440-4e13-a1b1-2fe268991f43','<p><strong>Chạy bộ là một môn thể thao&nbsp;đơn giản, dễ tiếp cận và mang lại nhiều lợi ích cho sức khỏe.</strong> Bạn chỉ cần một đôi giày thể thao tốt và động lực là có thể bắt đầu chạy bộ ngay lập tức.</p><p><strong>Tuy nhiên, nếu bạn muốn chạy bộ hiệu quả và bền vững, bạn nên tham khảo&nbsp;các chỉ dẫn đúng đắn.</strong> Trong bài viết này, chúng tôi sẽ cung cấp cho bạn tất cả những thông tin cần thiết để bắt đầu và duy trì thói quen chạy bộ của mình.</p><p>Trước khi bắt đầu, bạn hãy lưu lại các tài liệu sau của chúng tôi, nó sẽ giúp bạn rất nhiều trong hành trình chạy bộ sắp tới:</p><ul><li><a href=\"https://happyrun.vn/blogs/chaybo/chay-bo-co-tac-dung-gi\">Tác dụng của chạy bộ</a>: Động lực giúp bạn duy trì chạy bộ</li><li><a href=\"https://happyrun.vn/blogs/chaybo/thuat-ngu-chay-bo\">Thuật ngữ chạy bộ</a>: Giải ngố chạy bộ</li><li><a href=\"https://happyrun.vn/blogs/tap-luyen/chay-bo-dung-cach\">Chạy bộ đúng cách</a>: Tối đa lợi ích chạy bộ và Phòng tránh chấn thương</li><li><a href=\"https://happyrun.vn/pages/giao-an-chay-bo-moi-cap-do\">Giáo án chạy bộ</a>: Nơi giúp bạn tìm thấy chương trình luyện tập phù hợp.</li><li><a href=\"https://happyrun.vn/blogs/phong-tranh-chan-thuong/cach-hit-tho-khi-chay-bo\">Cách hít thở khi chạy bộ</a>: kỹ thuật giúp bạn chạy dài hơn mà không mệt</li><li><a href=\"https://happyrun.vn/blogs/tap-luyen/che-do-dinh-duong-cho-nguoi-chay-bo\">Dinh dưỡng trong chạy bộ</a>: Tối ưu hóa lợi ích từ chạy bộ</li></ul><p>Giờ chúng ta cùng bắt đầu!</p>','Những lưu ý cho người mới chạy bộ','f63f641e-4d05-439e-8449-25adf8d6b1fe','83f3ec23-0d4e-4125-9999-7d0cf25543f0',NULL),('5955a6fc-bbc8-4355-add9-549336db9ba4',1702743529374,1702743529424,NULL,'7e68977b-2440-4e13-a1b1-2fe268991f43','<p>&nbsp;magazine than afterwards lament a specific climax belly indeed loftily cheek a growing garrison fixture while violently beseech a deadly head logo lest cheerfully trivialise a important bonk linkage as patiently culminate a immaterial demo handsaw likewise recklessly eat a imperturbable metamorphose burn-out for vivaciously alight a beloved coarsen insight because thoughtfully weave a open.</p>','Ăn gì để no','a019eec1-e81d-4195-af8d-d9e9d92fbab8','83f3ec23-0d4e-4125-9999-7d0cf25543f0',NULL),('8cd8ad21-aa29-4ae0-bdaf-c172eedbff2e',1702889699712,1702889758891,'https://cali.vn/blog/yoga-giam-mo-bung','63c57e3d-0489-42d2-accd-764cf3a53edf','<figure class=\"image\"><img style=\"aspect-ratio:5521/3039;\" src=\"https://firebasestorage.googleapis.com/v0/b/vue-authentication-5990a.appspot.com/o/blogs%2F1702889754659R.jpg?alt=media&amp;token=f4f27552-c85f-46af-8d51-350988768618\" width=\"5521\" height=\"3039\"></figure><p><i><strong>Với những bạn có vòng hai quá cỡ nhưng lại ngại vận động mạnh thì những bài tập yoga giúp&nbsp;săn chắc vòng 2&nbsp;chính là lựa chọn hoàn hảo. Không chỉ hỗ trợ giảm cân, cải thiện vóc dáng, yoga còn giúp bạn có được tinh thần thoải mái và hứng khởi. Trong bài viết sau, California Fitness sẽ giới thiệu cho bạn 10&nbsp;tư thế&nbsp;</strong></i><a href=\"https://cali.vn/blog/yoga-giam-mo-bung\"><i><strong>yoga giảm mỡ bụng</strong></i></a><i><strong> siêu hiệu quả ngay tại nhà chỉ với 20 phút mỗi ngày. Tìm hiểu ngay nào!</strong></i></p>','10 tư thế yoga eo thon siêu tốc tại nhà','623922b7-7779-4c33-a4ef-ec72f4332e1b','25657977-c4d7-40cd-bcae-d0326da7866d',NULL),('be58de19-a806-42cb-92f3-d3a4aa3c75b5',1702889621330,1702889621364,'https://cali.vn/blog/tap-co-bung-tai-nha','63c57e3d-0489-42d2-accd-764cf3a53edf','<figure class=\"image\"><img style=\"aspect-ratio:998/561;\" src=\"https://firebasestorage.googleapis.com/v0/b/vue-authentication-5990a.appspot.com/o/blogs%2F1702889606552blog-4.jpg?alt=media&amp;token=c8f437cf-00df-489d-acad-1c4956b6c6e2\" width=\"998\" height=\"561\"></figure><p><i><strong>Đánh tan mỡ bụng và sở hữu 6 múi là niềm khao khát của nhiều cánh mày râu. Trong bài viết dưới đây, CFYC xin chia sẻ với bạn 7&nbsp;bài tập cơ bụng có thể biến ước mơ của bạn thành sự thật. Với 12 bài </strong></i><a href=\"https://cali.vn/blog/tap-co-bung-tai-nha\"><i><strong>tập cơ bụng tại nhà</strong></i></a><i><strong> đơn giản này, các bạn có thể dễ dàng thực hiện&nbsp;tại nhà mà vẫn sở hữu 6 múi lý tưởng như các bạn gymer. Nào, chúng ta hãy cùng điểm qua các bài tập nhé!</strong></i></p>','12 bài tập cơ bụng dễ có 6 múi nhất','623922b7-7779-4c33-a4ef-ec72f4332e1b','25657977-c4d7-40cd-bcae-d0326da7866d',NULL),('dd58e67d-18d7-420d-b31e-17ee05823f98',1702889654817,1702889654852,'https://cali.vn/blog/ngoi-thien-dung-cach','63c57e3d-0489-42d2-accd-764cf3a53edf','<figure class=\"image\"><img style=\"aspect-ratio:1000/690;\" src=\"https://firebasestorage.googleapis.com/v0/b/vue-authentication-5990a.appspot.com/o/blogs%2F1702889643902blog-3.jpg?alt=media&amp;token=0dc17114-2f5d-41b5-b7d6-66923d7d8521\" width=\"1000\" height=\"690\"></figure><p><i>Dân gian xưa có câu “Tâm an định thì trí sáng tỏ”. Thật vậy, phương pháp ngồi thiền không chỉ giúp rèn luyện tính kiên nhẫn, khả năng tập trung mà còn giúp tĩnh tâm, xua tan bớt những điều muộn phiền trong lòng. Do đó, thực hiện ngồi thiền mỗi ngày là hoạt động rất được khuyến khích. Tuy nhiên, để phát huy tác dụng tối đa của bộ môn này, bạn cần biết cách ngồi thiền đúng cách</i> <i><strong>.</strong></i><strong> </strong><i>Bài viết bên dưới sẽ giúp bạn giải đáp mọi thắc mắc liên quan đến những nguyên tắc khi </i><a href=\"https://cali.vn/blog/ngoi-thien-dung-cach\"><i>ngồi thiền đúng cách</i></a><i>. Cùng đọc ngay!</i></p>','12 nguyên tắc ngồi thiền đúng cách','623922b7-7779-4c33-a4ef-ec72f4332e1b','25657977-c4d7-40cd-bcae-d0326da7866d',NULL);
